import { connect } from 'react-redux';

class Test extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            test: ''
        }
    }

    handleTest = (e) => {
        this.setState({
            test: e.target.value
        });
    };

    handleSubmit = (e) => {
        e.preventDefault();

        const data = this.state;

        console.log('>>', data);

        axios.post('/api/test', data)
