        //         }
        //     });
        // console.log('v - 1');

    };

    render() {
        return (
            <div>
                <form onSubmit={this.handleSubmit}>
                    <input type="text"
                           onChange={this.handleTest}
                           value={this.state.test}
                    />
                    <button type={"Submit"} value={"submit"}>Submit</button>
                </form>
            </div>
        )
    }
}

